import React from 'react'
import { ParcelConsumer } from '../context';
import Loading from './Loading';
import Banner from './Banner';

export default function Month() {
    return (
			<ParcelConsumer>
				{
                    value => {
					const { loading } = value;
					if (loading) {
						return <Loading />;
					}
					return (
						<>
							<Banner/>
						</>
					);
                }
                }
			</ParcelConsumer>
		);
}
